import "./students.scss";
import students from "../../assets/data/student-data";


const Students = () => {
    const studentData = students.map(student => (
        <div class="container">
            <div class="row">
                <div class="col-sm">
                    <p>{student.first_name} {student.last_name}</p>
                </div>
                <div class="col-sm">
                    <p>{student.email}</p>
                </div>
                <div class="col-sm">
                    <p>{student.mobile_number}</p>
                </div>
                <div class="col-sm">
                    <p>{student.type}</p>
                </div>
                <div class="col-sm">
                    if (student.employed) {
                        <p>YES</p>
                    }
                </div>
                <div class="col-sm">
                    <p>{student.course_name}</p>
                </div>
            </div>
        </div>
    ))

    return (
        <div>
            {studentData}
        </div>
    )
}

export default Students;
